message:
Минобороны РФ: 

— российская авиация завоевала господство в воздухе над всей территорией Украины;

— российские силы взяли под контроль Бердянск и Энергодар, полностью охраняют и контролируют территорию вокруг Запорожской АЭС. Персонал АЭС продолжает работу по обслуживанию объектов и контролю радиоактивной обстановки в штатном режиме. Радиоактивный фон в норме.

Собянин смягчил антикоронавирусные ограничения в Москве:

— с 28 февраля отменяется блокировка транспортных карт для всех москвичей старше 60 лет и граждан, имеющих хронические заболевания;

— требование о переводе 30% работников на удалённый режим теперь носит рекомендательный характер.

Лавров:

— Никто не собирается оккупировать Украину;
— Зеленский сам упустил возможности переговоров по безопасности, не надо сейчас валить с больной головы на здоровую;
— Запад из эгоистических интересов не обращал внимание на ситуацию с правами человека в Донбассе;
— Зеленский врет, когда говорит о готовности обсуждать нейтральный статус Украины.

Минобороны РФ: 

— ВДВ России взяли вчера под полный контроль территорию в районе Чернобыльской АЭС;

— с военнослужащими украинского батальона охраны АЭС достигнута договоренность о совместном обеспечении безопасности энергоблоков и саркофага. Радиоактивный фон в норме. Персонал АЭС продолжает обслуживать объекты в штатном режиме и отслеживает радиоактивную обстановку;

— в районе острова Змеиный (Одесская область) сложили оружие и сдались 82 украинских военных, с них берут подписку об отказе от участия в боях, и в ближайшее время они будут возвращены к своим семьям;

— число выведенных из строя объектов военной инфраструктуры Украины возросло до 118.

Минобороны РФ: 

— обеспечен выход российских войск к Херсону, разблокирован Северо-Крымский канал, восстановлена подача воды в Крым;

— в результате российских ударов выведены из строя 83 наземных объекта военной инфраструктуры Украины, сбиты два украинских Су-27, два Су-24, один вертолет и четыре беспилотника "Байрактар ТБ-2".

Минобороны РФ: 

— все поставленные перед группировками российских войск на день задачи выполнены успешно;

— группировки войск ДНР и ЛНР прорвали хорошо оборудованную оборону украинских войск и продвинулись на 6-8 км - благодаря огневой поддержке российской артиллерии и армейской авиации.

Джонсон: 

— Британия вводит санкции против "Аэрофлота";

— вводим ограничения на суммы, которые россияне могут держать на счетах в Британии;

— Британия запрещает экспорт высокотехнологичной продукции в Россию.

Первая международная реакция на признание Россией независимости ДНР И ЛНР:

— НАТО призвало Москву выбрать путь дипломатии, альянс поддерживает суверенитет и территориальную целостность Украины;

— МИД Германии назвал это грубым нарушением международного права и ударом по всем дипломатическим усилиям;

— Премьер Польши призывает срочно собрать саммит ЕС и наложить на Россию санкции за признание ЛНР и ДНР;

— Британия скоординирует действия со своими союзниками в связи с признанием РФ независимости ЛНР и ДНР;

— Сирия будет готова признать ЛНР и ДНР — Асад;

— 85% сербов будут на стороне России, что бы ни произошло — Вучич.

