Замглавы администрации президента РФ Козак на заседании Совбеза: 

— ни Украине, ни её западным союзникам Донбасс не нужен;

— переговорный процесс находится на нулевой отметке 2015-го года;

— очевидно, что Украина не видит возможности особого статуса для Донбасса;

— все предложения от ЛНР и ДНР в контактной группе игнорируются;

— Украина придерживается формата "юридического кретинизма";

— киевские власти никогда не будут выполнять Минские соглашения.

SHOT

Выступление Путина на экстренном заседании Совбеза. Главное: 

— Переворот на Украине был антиконституционным и кровавым, часть жителей его не приняла;

— Россия изначально делала всё, чтобы мирным путем решить противоречия в Донбассе;

— Киевские власти не собираются исполнять Минские соглашения, они публично многократно об этом заявляли; 

— Также киевские власти дважды провели карательные операции в Донбассе, сейчас обострение происходит в третий раз;

— Цель сегодняшнего заседания — определить шаги по Донбассу, имея в виду обращения ДНР и ЛНР с просьбой признать их независимость;

— Вопросы признания ДНР и ЛНР тесно связаны с глобальными проблемами обеспечения безопасности в мире;  

— Если Украину примут в НАТО, угрозы для России многократно возрастут.

SHOT

Обращения глав ДНР и ЛНР к Путину с просьбами о признании независимости республик. 

Пушилин:

— Поблагодарил Путина за отношение к жителям Донбасса;

— Попросил рассмотреть заключение договора о сотрудничестве между Россией и ДНР;

— Попросил предусмотреть в договоре о сотрудничестве между Россией и ДНР возможность взаимодействия в оборонной сфере.

Пасечник: 

— Заявил, что есть информация о подготовке Киева к полномасштабному наступлению на Донбасс;

— Попросил рассмотреть возможность заключения договора о сотрудничестве с Россией, в том числе оборонном.

